                    Wrapper.Estimate(solarElevationList[iday],incidentDiffuseIrradiancePARList[iday], incidentDirectIrradiancePARList[iday] ,incidentDiffuseIrradianceNIRList[iday],
                                      incidentDirectIrradianceNIRList[iday], layerGAIList[iday], CumulTTList[iday], CumulTTFlagLeafList[iday], CumulTTSpikletList[iday], 
                                      PhyllochonList[iday], haunStageList[iday], FinalLeafNumberList[iday]);
                     #region Console Write


                    int lenZC = spaceZC.Length;

                    foreach(string iss in Wrapper.absIrradianceDictionary.Keys){
                        foreach (int ih in Wrapper.absIrradianceDictionary[iss].Keys){
                            foreach (int il in Wrapper.absIrradianceDictionary[iss][ih].Keys)
                            {
                                string Iabs = "";
                                string IabsDiff = "";
                                string IabsDir = "";

                                if (choiceOpt < 8)
                                {
                                    if (Wrapper.absIrradianceDictionary[iss][ih][il] > 0.0001) Iabs = Wrapper.absIrradianceDictionary[iss][ih][il].ToString().Substring(0, 5);
                                    else Iabs = "0.000";
                                }
                                else
                                {
                                    if (Wrapper.absorbedDiffIrradiance[ih][il] > 0.0001) IabsDiff = Wrapper.absorbedDiffIrradiance[ih][il].ToString().Substring(0, 5);
                                    else IabsDiff = "0.000";

                                    if (Wrapper.absorbedDirIrradiance[ih][il] > 0.0001) IabsDir = Wrapper.absorbedDirIrradiance[ih][il].ToString().Substring(0, 5);
                                    else IabsDir = "0.000";
                                }

                                if (il == 99)
                                {
                                    string GAITot = "";
                                    if (layerGAIList[iday].Sum(x => x.Value.Item1 + x.Value.Item2) != 0) GAITot = layerGAIList[iday].Sum(x => x.Value.Item1 + x.Value.Item2).ToString().Substring(0, 5);
                                    else GAITot = "0.0";

                                    if (choiceOpt < 8)
                                    {

                                        Console.WriteLine(iss + spaceZC.Substring(0, lenZC - iss.Length) + ih + spaceZC.Substring(0, lenZC - ih.ToString().Length)
                                                      + il + spaceZC.Substring(0, lenZC - il.ToString().Length) + GAITot + spaceZC.Substring(0, lenZC - GAITot.Length)
                                                      + Iabs);
                                    }
                                    else
                                    {
                                        Console.WriteLine(iss + spaceZC.Substring(0, lenZC - iss.Length) + ih + spaceZC.Substring(0, lenZC - ih.ToString().Length)
                                                      + il + spaceZC.Substring(0, lenZC - il.ToString().Length) + GAITot + spaceZC.Substring(0, lenZC - GAITot.Length)
                                                      + IabsDiff + spaceZC.Substring(0, lenZC - IabsDiff.ToString().Length) + IabsDir);
                                    }
                                }
                                else
                                {
                                    double gAI = layerGAIList[iday][il].Item1 + layerGAIList[iday][il].Item2;
                                    string GAIlay = "";

                                    if (gAI.ToString().Length >= 5) GAIlay = gAI.ToString().Substring(0, 5);
                                    else GAIlay = gAI.ToString();


                                    if (choiceOpt < 8)
                                    {

                                        Console.WriteLine(iss + spaceZC.Substring(0, lenZC - iss.Length) + ih + spaceZC.Substring(0, lenZC - ih.ToString().Length)
                                                      + il + spaceZC.Substring(0, lenZC - il.ToString().Length) + GAIlay + spaceZC.Substring(0, lenZC - GAIlay.ToString().Length)
                                                      + Iabs);
                                    }
                                    else
                                    {
                                        Console.WriteLine(iss + spaceZC.Substring(0, lenZC - iss.Length) + ih + spaceZC.Substring(0, lenZC - ih.ToString().Length)
                                                      + il + spaceZC.Substring(0, lenZC - il.ToString().Length) + GAIlay + spaceZC.Substring(0, lenZC - GAIlay.ToString().Length)
                                                      + IabsDiff + spaceZC.Substring(0, lenZC - IabsDiff.ToString().Length) + IabsDir);
                                    }
                                    
                                }
                            }

                        }

                    }



                     #endregion

                    iday++;
                }

                #region Console Write

                Console.Write("type \"C\" to continue, something else to exit");
                string brkcond = Console.ReadLine();
                if (brkcond != "C") break;

                #endregion
            }

        }
    }
